import React from 'react';

const CompCoatchMark = () => {
  return (
    <figure className='coatch-mark'>
      <img src={require('../../assets/img/end.png')} alt="" />
      <figcaption>
        <p>
          <input onChange={fnSetLoacalC} type="checkbox" />
            코치마크 비활성화
        </p>
        <button>skip</button>
      </figcaption>
    </figure>
  );
};

export default CompCoatchMark;
